reka"],"channelId":"UCkw4JCwteGrDHIsyIIKo4tQ","isOwnerViewing":false,"shortDescription":"Edureka AWS Certification Training (Use Code \"\"): https://www.edureka.co/aws-certification-training\nThis 'AWS Cloud Practitioner' tutorial video will give you a complete understanding of the AWS Cloud platform and help you prepare for the AWS Certified Cloud Practitioner Examination (a.k.a AWS CCP Examination). This AWS course is intended for individuals who need the knowledge and skills necessary to effectively demonstrate an overall understanding of the AWS Cloud, independent of specific technical roles addressed by other AWS Certifications.\nBelow are the topics covered in this AWS Cloud Practitioner session:\n00:00 Agenda\n06:50 Cloud Concepts\n12:36 Different Service Modules\n16:52 Deployment Models\n21:24 AWS Cloud Infrastructure\n38:46 Components of IAM\n40:28 Setting up MFA\n53:52 Elements of IAM Policy \n1:12:25 AWS Console Demo\n1:12:29 EC2\n1:42:40 AMI\n1:44:00 Auto Scaling Group\n1:56:38 Create Load Balancer\n2:03:15 S3\n2:10:41 Cloud Front\n2:15:05 RDS\n2:30:21 Lambda\n2:42:12 Technology Overview\n2:42:21 AWS Compute Domain\n2:59:38 AWS Storage Services\n3:06:52 AWS Database Services\n3:23:46 AWS Networking Services\n3:27:14 AWS Management Services\n3:23:30 AWS Security Services\n3:34:32 AWS Application Services\n3:37:05 AWS Pricing\n3:44:23 What is included in the Free Tier Account\n3:51:01 Cost Optimization\n\nSubscribe to our channel to get video updates. Hit the subscribe button above: https://goo.gl/6ohpTV\n\nTwitter: https://twitter.com/edurekain\nLinkedIn: https://www.linkedin.com/company/edureka\nInstagram: https://www.instagram.com/edureka_learning/\nFacebook: https://www.facebook.com/edurekaIN/   \nSlideShare: https://www.slideshare.net/EdurekaIN   \nCastbox: https://castbox.fm/networks/505?country=in\nMeetup:  https://www.meetup.com/edureka/\n\n#edureka #awsEdureka #AWSCloudPractitioner #AWSCloudpractionerfullcourse #AWSCertification #awstutorial #awstraining #learnAWS #withme\n\n---------------------------------------------------\nHow it Works?\n \n1. This is a 5 Weeks Instructor led Online Course, 30 hours of assignment and 20 hours of project work.\n2. We have a 24x7 One-on-One LIVE Technical Support to help you with any problems you might face or any clarifications you may require during the course.\n3. At the end of the training you will be working on a real time project for which we will provide you a Grade and a Verifiable Certificate!\n-------------------------------------------------------\n\nAbout The Course\n \nAWS holds 69% of the global market share in the cloud computing market. Some of the prominent companies who use AWS as their backbone are Kelloggs, Netflix, Adobe, Airbnb and General Electric. Irrespective of the size of an organization, everyone has started to adopt the cloud services in one way or the other, and AWS is the major player in the Cloud services industry.\nAWS Certification Training from Edureka is designed to provide in-depth knowledge about AWS architectural principles and its services. \n--------------------------------------------------\nWhat are the skills that you will be learning with our AWS Architect Certification Training?\n \nAWS Architect Certification is designed by industry experts to make you a certified AWS Solutions Architect. It will polish your skills by offering you comprehensive knowledge on Cloud computing. On the completion of the AWS Architect Training, learner will be able to:\n\n1) Design and deploy scalable, highly available, and fault tolerant systems on AWS\n2) Understand lift and shift of an existing on-premises application to AWS\n3) Ingress and egress of data to and from AWS\n4) Identify the appropriate AWS service based on data, compute, database, or security requirements\n5) Identify the appropriate use of AWS architectural best practices\n6) Estimate AWS costs and identifying cost control mechanisms\n----------------------------------------------- .youtube.com/embed/XjPUyGKRjZs","width":1280,"height":720},"title":{"simpleText":"AWS Cloud Practitioner | AWS Certified Cloud Practitioner - Full Course | AWS Training | Edureka"},"description":{"simpleText":"Edureka AWS Certification Training (Use Code \"\"): https://www.edureka.co/aws-certification-training\nThis 'AWS Cloud Practitioner' tutorial video will give you a complete understanding of the AWS Cloud platform and help you prepare for the AWS Certified Cloud Practitioner Examination (a.k.a AWS CCP Examination). This AWS course is intended for individuals who need the knowledge and skills necessary to effectively demonstrate an overall understanding of the AWS Cloud, independent of specific technical roles addressed by other AWS Certifications.\nBelow are the topics covered in this AWS Cloud Practitioner session:\n00:00 Agenda\n06:50 Cloud Concepts\n12:36 Different Service Modules\n16:52 Deployment Models\n21:24 AWS Cloud Infrastructure\n38:46 Components of IAM\n40:28 Setting up MFA\n53:52 Elements of IAM Policy \n1:12:25 AWS Console Demo\n1:12:29 EC2\n1:42:40 AMI\n1:44:00 Auto Scaling Group\n1:56:38 Create Load Balancer\n2:03:15 S3\n2:10:41 Cloud Front\n2:15:05 RDS\n2:30:21 Lambda\n2:42:12 Technology Overview\n2:42:21 AWS Compute Domain\n2:59:38 AWS Storage Services\n3:06:52 AWS Database Services\n3:23:46 AWS Networking Services\n3:27:14 AWS Management Services\n3:23:30 AWS Security Services\n3:34:32 AWS Application Services\n3:37:05 AWS Pricing\n3:44:23 What is included in the Free Tier Account\n3:51:01 Cost Optimization\n\nSubscribe to our channel to get video updates. Hit the subscribe button above: https://goo.gl/6ohpTV\n\nTwitter: https://twitter.com/edurekain\nLinkedIn: https://www.linkedin.com/company/edureka\nInstagram: https://www.instagram.com/edureka_learning/\nFacebook: https://www.facebook.com/edurekaIN/   \nSlideShare: https://www.slideshare.net/EdurekaIN   \nCastbox: https://castbox.fm/networks/505?country=in\nMeetup:  https://www.meetup.com/edureka/\n\n#edureka #awsEdureka #AWSCloudPractitioner #AWSCloudpractionerfullcourse #AWSCertification #awstutorial #awstraining #learnAWS #withme\n\n---------------------------------------------------\nHow it Works?\n \n1. This is a 5 Weeks Instructor led Online Course, 30 hours of assignment and 20 hours of project work.\n2. We have a 24x7 One-on-One LIVE Technical Support to help you with any problems you might face or any clarifications you may require during the course.\n3. At the end of the training you will be working on a real time project for which we will provide you a Grade and a Verifiable Certificate!\n-------------------------------------------------------\n\nAbout The Course\n \nAWS holds 69% of the global market share in the cloud computing market. Some of the prominent companies who use AWS as their backbone are Kelloggs, Netflix, Adobe, Airbnb and General Electric. Irrespective of the size of an organization, everyone has started to adopt the cloud services in one way or the other, and AWS is the major player in the Cloud services industry.\nAWS Certification Training from Edureka is designed to provide in-depth knowledge about AWS architectural principles and its services. \n--------------------------------------------------\nWhat are the skills that you will be learning with our AWS Architect Certification Training?\n \nAWS Architect Certification is designed by industry experts to make you a certified AWS Solutions Architect. It will polish your skills by offering you comprehensive knowledge on Cloud computing. On the completion of the AWS Architect Training, learner will be able to:\n\n1) Design and deploy scalable, highly available, and fault tolerant systems on AWS\n2) Understand lift and shift of an existing on-premises application to AWS\n3) Ingress and egress of data to and from AWS\n4) Identify the appropriate AWS service based on data, compute, database, or security requirements\n5) Identify the appropriate use of AWS architectural best practices\n6) Estimate AWS costs and identifying cost control mechanisms\n----------------------------------------------------\n\nWho should go for this AWS Architect Certification Training?\n \nThis AWS Certification Training is designed for the IT professionals who want to pursue a career in Cloud Computing and become AWS Certified Solutions Architect. Our AWS Architect Certification Training helps you to grab this opportunity and accelerate your career. It is best suited for:\n1) Professionals who want Project Experience in migrating and deploying AWS solutions\n2) Professionals with IT Infrastructure background\n3) Professionals with Virtualisation experience\n4) DevOps professionals\n5) Professionals with the understanding of the application, server, and network security and compliance\n\nFor more information, Please write back to us at sales@edureka.co or call us at IND: 9606058406 / US: 18338555775 (toll free).\nGot a question on the topic? Please share it in the comment section below and our experts will answer it for you. \n\nFor more information, please write back to us at sales@edureka.in or call us at IND: 9606058406 / US: 18338555775 (toll-free)."},"lengthSeconds":"14085","ownerProfileUrl":"http://www.youtube.com/@edurekaIN","externalChannelId":"UCkw4JCwteGrDHIsyIIKo4tQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR IMATION_ORIGIN_SMARTIMATION"}}},"metadataRowContainer":{"metadataRowContainerRenderer":{"collapsedItemCount":2,"trackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5"}},"showMoreText":{"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"trackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CKUEEM2rARgBIhMI9aHTi828ggMV7j3xBR2dBwQ5","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Edureka AWS Certification Training (Use Code \"\"): https://www.edureka.co/aws-certificat...\nThis 'AWS Cloud Practitioner' tutorial video will give you a complete understanding of the AWS Cloud platform and help you prepare for the AWS Certified Cloud Practitioner Examination (a.k.a AWS CCP Examination). This AWS course is intended for individuals who need the knowledge and skills necessary to effectively demonstrate an overall understanding of the AWS Cloud, independent of specific technical roles addressed by other AWS Certifications.\nBelow are the topics covered in this AWS Cloud Practitioner session:\n00:00 Agenda\n06:50 Cloud Concepts\n12:36 Different Service Modules\n16:52 Deployment Models\n21:24 AWS Cloud Infrastructure\n38:46 Components of IAM\n40:28 Setting up MFA\n53:52 Elements of IAM Policy \n1:12:25 AWS Console Demo\n1:12:29 EC2\n1:42:40 AMI\n1:44:00 Auto Scaling Group\n1:56:38 Create Load Balancer\n2:03:15 S3\n2:10:41 Cloud Front\n2:15:05 RDS\n2:30:21 Lambda\n2:42:12 Technology Overview\n2:42:21 AWS Compute Domain\n2:59:38 AWS Storage Services\n3:06:52 AWS Database Services\n3:23:46 AWS Networking Services\n3:27:14 AWS Management Services\n3:23:30 AWS Security Services\n3:34:32 AWS Application Services\n3:37:05 AWS Pricing\n3:44:23 What is included in the Free Tier Account\n3:51:01 Cost Optimization\n\nSubscribe to our channel to get video updates. Hit the subscribe button above: https://goo.gl/6ohpTV\n\nTwitter: /edurekain\nLinkedIn: /edureka\nInstagram: /edureka_learning\nFacebook: /edurekain   \nSlideShare: https://www.slideshare.net/EdurekaIN   \nCastbox: https://castbox.fm/networks/505?count...\nMeetup:  https://www.meetup.com/edureka/\n\n#edureka #awsEdureka #AWSCloudPractitioner #AWSCloudpractionerfullcourse #AWSCertification #awstutorial #awstraining #learnAWS #withme\n\n---------------------------------------------------\nHow it Works?\n \n1. This is a 5 Weeks Instructor led Online Course, 30 hours of assignment and 20 hours of project work.\n2. We have a 24x7 One-on-One LIVE Technical Support to help you with any problems you might face or any clarifications you may require during the course.\n3. At the end of the training you will be working on a real time project for which we will provide you a Grade and a Verifiable Certificate!\n-------------------------------------------------------\n\nAbout The Course\n \nAWS holds 69% of the global market share in the cloud computing market. Some of the prominent companies who use AWS as their backbone are Kelloggs, Netflix, Adobe, Airbnb and General Electric. Irrespective of the size of an organization, everyone has started to adopt the cloud services in one way or the other, and AWS is the major player in the Cloud services industry.\nAWS Certification Training from Edureka is designed to provide in-depth knowledge about AWS architectural principles and its services. \n--------------------------------------------------\nWhat are the skills that you will be learning with our AWS Architect Certification Training?\n \nAWS Architect Certification is designed by industry experts to make you a certified AWS Solutions Architect. It will polish your skills by offering you comprehensive knowledge on Cloud computing. On the completion of the AWS Architect Training, learner will be able to:\n\n1) Design and deploy scalable, highly available, and fault tolerant systems on AWS\n2) Understand lift and shift of an existing on-premises application to AWS\n3) Ingress and egress of data to and from AWS\n4) Identify the appropriate AWS service based on data, compute, database, or security requirements\n5) Identify the appropriate use of AWS architectural best practices\n6) Estimate AWS costs and identifying cost control mechanisms\n----------------------------------------------------\n\nWho should go for this AWS Architect Certification Training?\n \nThis AWS Certification Training is designed for the IT professionals who want to pursue a career in Cloud Computing and become AWS Certified Solutions Architect. Our AWS Architect Certification Training helps you to grab this opportunity and accelerate your career. It is best suited for:\n1) Professionals who want Project Experience in migrating and deploying AWS solutions\n2) Professionals with IT Infrastructure background\n3) Professionals with Virtualisation experience\n4) DevOps professionals\n5) Professionals with the understanding of the application, server, and network security and compliance\n\nFor more information, Please write back to us at sales@edureka.co or call us at IND: 9606058406 / US: 18338555775 (toll free).\nGot a question on the topic? Please share it in the comment section below and our experts will answer it for you. \n\nFor more information, please write back to us at sales@edureka.in or call us at IND: 9606058406 / US: 18338555775 (toll-free).","commandRuns":[ 3:06:52 AWS Database Services\n3:23:46 AWS Networking Services\n3:27:14 AWS Management Services\n3:23:30 AWS Security Services\n3:34:32 AWS Application Services\n3:37:05 AWS Pricing\n3:44:23 What is included in the Free Tier Account\n3:51:01 Cost Optimization\n\nSubscribe to our channel to get video updates. Hit the subscribe button above: https://goo.gl/6ohpTV\n\nTwitter: /edurekain\nLinkedIn: /edureka\nInstagram: /edureka_learning\nFacebook: /edurekain   \nSlideShare: https://www.slideshare.net/EdurekaIN   \nCastbox: https://castbox.fm/networks/505?count...\nMeetup:  https://www.meetup.com/edureka/\n\n#edureka #awsEdureka #AWSCloudPractitioner #AWSCloudpractionerfullcourse #AWSCertification #awstutorial #awstraining #learnAWS #withme\n\n---------------------------------------------------\nHow it Works?\n \n1. This is a 5 Weeks Instructor led Online Course, 30 hours of assignment and 20 hours of project work.\n2. We have a 24x7 One-on-One LIVE Technical Support to help you with any problems you might face or any clarifications you may require during the course.\n3. At the end of the training you will be working on a real time project for which we will provide you a Grade and a Verifiable Certificate!\n-------------------------------------------------------\n\nAbout The Course\n \nAWS holds 69% of the global market share in the cloud computing market. Some of the prominent companies who use AWS as their backbone are Kelloggs, Netflix, Adobe, Airbnb and General Electric. Irrespective of the size of an organization, everyone has started to adopt the cloud services in one way or the other, and AWS is the major player in the Cloud services industry.\nAWS Certification Training from Edureka is designed to provide in-depth knowledge about AWS architectural principles and its services. \n--------------------------------------------------\nWhat are the skills that you will be learning with our AWS Architect Certification Training?\n \nAWS Architect Certification is designed by industry experts to make you a certified AWS Solutions Architect. It will polish your skills by offering you comprehensive knowledge on Cloud computing. On the completion of the AWS Architect Training, learner will be able to:\n\n1) Design and deploy scalable, highly available, and fault tolerant systems on AWS\n2) Understand lift and shift of an existing on-premises application to AWS\n3) Ingress and egress of data to and from AWS\n4) Identify the appropriate AWS service based on data, compute, database, or security requirements\n5) Identify the appropriate use of AWS architectural best practices\n6) Estimate AWS costs and identifying cost control mechanisms\n----------------------------------------------------\n\nWho should go for this AWS Architect Certification Training?\n \nThis AWS Certification Training is designed for the IT professionals who want to pursue a career in Cloud Computing and become AWS Certified Solutions Architect. Our AWS Architect Certification Training helps you to grab this opportunity and accelerate your career. It is best suited for:\n1) Professionals who want Project Experience in migrating and deploying AWS solutions\n2) Professionals with IT Infrastructure background\n3) Professionals with Virtualisation experience\n4) DevOps professionals\n5) Professionals with the understanding of the application, server, and network security and compliance\n\nFor more information, Please write back to us at sales@edureka.co or call us at IND: 9606058406 / US: 18338555775 (toll free).\nGot a question on the topic? Please share it in the comment section below and our experts will answer it for you. \n\nFor more information, please write back to us at sales@edureka.in or call us at IND: 9606058406 / US: 18338555775 (toll-free).","commandRuns":[{"startIndex":70,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCwQ040EGAUiEwj1odOLzbyCAxXuPfEFHZ0HBDlIm5vGlIaZ9Zle","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/
